import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import DialogItem from "./components/Dialogs/DialogItem/DialogItem";
import Post from "./components/Profile/myPosts/Post/Post";

let dialogsData = [
    {id: 1, name: "Roman"},
    {id: 2, name: "Daniel"},
    {id: 3, name: "Max"}]

let messagesData = [
    {id: 1, message: "Hi"},
    {id: 2, message: "When will u connect Mongo Homie???)))"},
    {id: 3, message: "AHAHAHAHhHH"}]

let postData = [
    {id:1, message: "Hi,from Java man", likesCount: 25},
    {id:1, message: "Python the best_ ho-ho-ho", likesCount: 55}
]



ReactDOM.render(
  <React.StrictMode>
    <App allDialogs={dialogsData} allPosts={postData} allMessages={messagesData}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
